import React from "react";
import axios from "axios";

export default class SongList extends React.Component {
  state = {
    songs: [],
  };

  componentDidMount() {
    axios
      .get(
        `https://www.abbreviations.com/services/v2/lyrics.php?uid=7926&tokenid=f0ZBfcDiL9WPYeCR&term=forever%20young&format=json`
      )
      .then((res) => {
        console.log(res);
        this.setState({ songs: res.data.result });
      });
  }

  render() {
    return (
      <ul>
        {this.state.songs.slice(0, 10).map((result) => (
          <li>{result.album}</li>
        ))}
      </ul>
    );
  }
}
